import React, { Component } from 'react'
import './Row.css'

export default class Row extends Component {
    render() {

        return (
            <div className="row">
                <h2>{this.props.title}</h2>
                {this.props.movies.map(movie => (
                    <img
                    className="poster"
                    src={`${base_img_url}${movie["poster"]}`}
                    />
                ))}
            </div>
        )
    }
}
